import React from 'react';
import "../hojas-de-estilo/Carro_Perfil.css";
import imgCarro from "../images/icon-cart.svg";
import imgAvatar from "../images/image-avatar.png";

function Carro_Perfil(){
    return(
        <div className='cont_carro_avatar'>
            <div><img src={imgAvatar} alt="imagen_perfil" /></div>
            <div><img src={imgCarro} alt="carrito_compra" /></div>
            
        </div>
    );
}

export default Carro_Perfil;
